DETAIL_TEXT:
Хороший препарат. Даю кошке раз в полгода. 
Не нашла на сайте информации о дозировке. 
Если вы приобрели упаковку с концентрацией активных компонентов, рассчитанных на питомца от 2 кг, то схема приёма следующая:

0, 5 таблетки для котов от 2 до 4 кг;
1 таблетка для питомцев 4 – 8 кг;
1, 5 таблетки для представителей крупных пород т 8 кг.
